INSERT INTO `wp_options` VALUES("1560", "_transient_dash_4077549d03da2e451c8b5f002294ff51", "<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wordpress.org/news/2015/05/wordpress-4-2-2/\'>WordPress 4.2.2 Security and Maintenance Release</a> <span class=\"rss-date\">May 7, 2015</span><div class=\"rssSummary\">WordPress 4.2.2 is now available. This is a critical security release for all previous versions and we strongly encourage you to update your sites immediately. Version 4.2.2 addresses two security issues: The Genericons icon font package, which is used in a number of popular themes and plugins, contained an HTML file vulnerable to a cross-site [&hellip;]</div></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'http://ma.tt/2015/05/wearable-gadgets/\'>Matt: Wearable Gadgets</a></li><li><a class=\'rsswidget\' href=\'http://wptavern.com/wp-engine-rolls-out-wp-cli-support-to-select-partners-for-beta-testing\'>WPTavern: WP Engine Rolls Out WP-CLI Support to Select Partners for Beta Testing</a></li><li><a class=\'rsswidget\' href=\'http://wptavern.com/wp-rollback-provides-basic-versioning-for-wordpress-org-plugins-and-themes\'>WPTavern: WP Rollback Provides Basic Versioning for WordPress.org Plugins and Themes</a></li></ul></div><div class=\"rss-widget\"><ul><li class=\'dashboard-news-plugin\'><span>Popular Plugin:</span> <a href=\'https://wordpress.org/plugins/mailchimp-for-wp/\' class=\'dashboard-news-plugin-link\'>MailChimp for WordPress</a>&nbsp;<span>(<a href=\'plugin-install.php?tab=plugin-information&amp;plugin=mailchimp-for-wp&amp;_wpnonce=8925493880&amp;TB_iframe=true&amp;width=600&amp;height=800\' class=\'thickbox\' title=\'MailChimp for WordPress\'>Install</a>)</span></li></ul></div>", "no");
